import React,{Component} from 'react';

class MandalArtTable extends Component {

    render() {
        return (
            <div className="grid inner-grid justify-between items-center">
                <textarea value={aa} onChange={onChange}/>
                <textarea value={ab} onChange={onChange}/>
                <textarea value={ac} onChange={onChange}/>
                <textarea value={ba} onChange={onChange}/>
                <textarea value={bb} onChange={onChange}/>
                <textarea value={bc} onChange={onChange}/>
                <textarea value={ca} onChange={onChange}/>
                <textarea value={cb} onChange={onChange}/>
                <textarea value={cc} onChange={onChange}/>
            </div>

        );
    }
};

export default MandalArtTable;
